import React, { useState, useEffect } from 'react';
import './CreateCardPage.css';

function CreateCardPage() {
  const [cards, setCards] = useState([]);
  const [front, setFront] = useState('');
  const [back, setBack] = useState('');
  const [quizIndex, setQuizIndex] = useState(0);
  const [userAnswer, setUserAnswer] = useState('');
  const [showAnswer, setShowAnswer] = useState(false);

  // Load saved cards
  useEffect(() => {
    const saved = localStorage.getItem('myFlashcards');
    if (saved) setCards(JSON.parse(saved));
  }, []);

  // Save to localStorage when cards change
  useEffect(() => {
    localStorage.setItem('myFlashcards', JSON.stringify(cards));
  }, [cards]);

  const addCard = () => {
    if (front.trim() && back.trim()) {
      setCards([...cards, { front, back }]);
      setFront('');
      setBack('');
    }
  };

  const deleteCard = (index) => {
    const updated = [...cards];
    updated.splice(index, 1);
    setCards(updated);
  };

  const clearAll = () => {
    setCards([]);
    setQuizIndex(0);
    setUserAnswer('');
    setShowAnswer(false);
  };

  const nextQuizCard = () => {
    setUserAnswer('');
    setShowAnswer(false);
    setQuizIndex((prev) => (prev + 1) % cards.length);
  };

  return (
    <div className="create-page">
      <h1>üß† Flashcard Maker & Quiz</h1>

      <div className="create-section">
        <h2>Create New Flashcard</h2>
        <input
          type="text"
          placeholder="Front (Question)"
          value={front}
          onChange={(e) => setFront(e.target.value)}
        />
        <input
          type="text"
          placeholder="Back (Answer)"
          value={back}
          onChange={(e) => setBack(e.target.value)}
        />
        <button onClick={addCard}>‚ûï Add Card</button>
        <button onClick={clearAll} className="clear-button">üóë Clear All</button>
      </div>

      <div className="card-list">
        <h2>üóÇÔ∏è Your Cards ({cards.length})</h2>
        <ul>
          {cards.map((card, i) => (
            <li key={i}>
              <div>
                <strong>Q:</strong> {card.front}<br />
                <strong>A:</strong> {card.back}
              </div>
              <button onClick={() => deleteCard(i)}>‚ùå</button>
            </li>
          ))}
        </ul>
      </div>

      {cards.length > 0 && (
        <div className="quiz-section">
          <h2>üìù Test Yourself</h2>
          <div className="quiz-card">
            <p><strong>Q:</strong> {cards[quizIndex].front}</p>
            <input
              type="text"
              placeholder="Your answer..."
              value={userAnswer}
              onChange={(e) => setUserAnswer(e.target.value)}
            />
            {showAnswer && (
              <p className="correct-answer">
                ‚úÖ Correct: {cards[quizIndex].back}
              </p>
            )}
            <div className="quiz-controls">
              <button onClick={() => setShowAnswer(true)}>üëÅ Show Answer</button>
              <button onClick={nextQuizCard}>‚û°Ô∏è Next</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default CreateCardPage;
